            $ImageLink = $JsonParameters.PSobject.Properties["image_link"].value
        }

        if (!([bool]($JsonParameters.PSobject.Properties.name -match "video_link"))) { #optional property not found
            $VideoLink = $null
        } else {
            $VideoLink = $JsonParameters.PSobject.Properties["video_link"].value
        }

        $PSO = [PSCustomObject]@{
            "ad_link" = ${AdLink}
            "adult" = ${Adult}
